import React from "react";
import { Link } from "react-router-dom";
import logo from '../asset/img/logo192.png';

function Login(){
    return(
        <div className="container">
            <div className="row">
                <div className="col">

                </div>
                <div className="col">
                    <div className="text-end">
                        <img src={logo}></img>
                    </div>
                    <div className="fw-bold text-center py-5">Bienvenido</div>

                    <form action="/">
                        <div className="mb-4">
                            <label for="email" className="form-label">Correo</label>
                            <input type="email" className="form-control">Email</input>
                        </div>
                        <div className="mb-4"></div>
                        <div className="mb-4"></div>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default Login;
